(function () {
    "use strict";

    function prepareComponentList(choices, components) {
        console.log('Preparing component list from fetched components', components);
        var componentList = {
            learn: {
                label: "Learn ZF",
                disabled: false,
                choices: []
            },
            middleware: {
                label: "Expressive and PSR-15 Middleware",
                disabled: false,
                choices: []
            },
            mvc: {
                label: "MVC Framework",
                disabled: false,
                choices: []
            },
            components: {
                label: "Components",
                disabled: false,
                choices: []
            },
            projects: {
                label: "Tooling and Composer Plugins",
                disabled: false,
                choices: []
            },
        };
        var uncategorized = [];

        components.forEach(function (component) {
            // eslint-disable-next-line no-use-before-define
            const selected = component.url.indexOf(siteName) !== -1;
            const label = component.name + " (" + component.package + ")";
            const choice = {
                value: component.url,
                label: label,
                selected: selected,
                customProperties: {
                    description: component.description
                }
            };

            componentList.hasOwnProperty(component.group)
                ? componentList[component.group].choices.push(choice)
                : uncategorized.push(choice);
        });

        const choiceList = Array.prototype.concat.apply(Object.values(componentList), uncategorized);
        console.log('Setting choices', choiceList);
        choices.setChoices(choiceList, 'value', 'label', true);
    }

    function parseComponentList(choices) {
        return function(event) {
            var request = event.target;
            if (request.readyState === request.DONE && request.status === 200) {
                prepareComponentList(choices, JSON.parse(request.responseText));
            }
        };
    }

    function loadComponentList(choices) {
        console.log('Loading component list');
        var request                = new XMLHttpRequest();
        request.onreadystatechange = parseComponentList(choices);
        request.open('GET', '//docs.zendframework.com/zf-mkdoc-theme/scripts/zf-component-list.json');
        request.send();
    }

    function getComponentSelector() {
        console.log('Locating component selector');
        var selectors = [];
        const nodeList = document.querySelectorAll('.component-selector__control');
        for (var i = 0; i < nodeList.length; i += 1) {
            selectors.push(nodeList[i]);
        }

        if (selectors.length === 0) {
            return;
        }

        return selectors.shift();
    }

    // Locate the component selector, if we have one
    const componentSelector = getComponentSelector();
    if (! componentSelector) {
        console.log('No component selector found!');
        return;
    }
    console.log('Found component selector', componentSelector);

    // Initialize the Choices selector using the component selector as its element
    const choices = new Choices(componentSelector, {
        addItems: false,
        removeItems: false,
        editItems: false,
        duplicateItems: false,
        searchFields: ['label', 'value', 'customProperties.description']
    });

    // On selection of a choice, redirect to its URL
    componentSelector.addEventListener('choice', function (value) {
        window.location.href = value;
    }, false);

    // Finally, populate the list
    loadComponentList(choices);
})();

(function () {
    "use strict";

    // Tables
    var tables = document.querySelectorAll('.content table');
    if (tables.length) {
        [].forEach.call(tables, function(element) {
            element.classList.add('table', 'table-striped', 'table-hover');
        });
    }

    // Anchors
    anchors.options.placement = 'left';
    anchors.add(
        '.content h1:not(.content__title), .content h2, .content > h3, .content h4, .content h5'
    );

    // Pre elements
    var preElements = document.querySelectorAll('pre');
    [].forEach.call(preElements, function(element) {
        element.classList.add('line-numbers');
    });

    // Search modal
    $('#mkdocs_search_modal').on('shown.bs.modal', function () {
        $('#mkdocs-search-query').focus();
    });

    // Shift window
    var shiftWindow = function () {
        scrollBy(0, -50)
    };
    if (location.hash) {
        shiftWindow();
    }
    window.addEventListener('hashchange', shiftWindow);
})();
